import React from "react";

const navItems = [
  "NEWS",
  "StudyGuides",
  "Subject Prescription",
  "B.S Access",
  "Public",
  "Student",
  "Staff",
  "Profile",
  "Academic Report",
  "Tests",
  "Misc",
  "Attendance",
  "Lecture Assessments",
  "Vlabs",
  "Qualifications",
  "Subject List",
];

function Home() {
  return (
    <div>
      <nav style={{ background: "#f0f0f0", padding: "10px" }}>
        <ul style={{ display: "flex", listStyle: "none", margin: 0, padding: 0, flexWrap: "wrap" }}>
          {navItems.map((item) => (
            <li key={item} style={{ marginRight: "20px" }}>
              <a href={`#${item.replace(/\s+/g, '').toLowerCase()}`} style={{ textDecoration: "none", color: "#333" }}>
                {item}
              </a>
            </li>
          ))}
        </ul>
      </nav>
      <h1>Electronic Campus</h1>
      <></>
    </div>
  );
}

export default Home;
